DROP TABLE IF EXISTS "user_cart_item";
DROP TABLE IF EXISTS "collection";
DROP TABLE IF EXISTS "collection_product";
DROP TABLE IF EXISTS "order_item";
DROP TABLE IF EXISTS "order_operate_history";
DROP TABLE IF EXISTS "order_return_apply";
DROP TABLE IF EXISTS "order";
DROP TABLE IF EXISTS "product_attribute";
DROP TABLE IF EXISTS "product_attribute_value";
DROP TABLE IF EXISTS "product_category_attribute_relation";
DROP TABLE IF EXISTS "product_category";
DROP TABLE IF EXISTS "product_detail_template";
DROP TABLE IF EXISTS "product_detail_template_relation";
DROP TABLE IF EXISTS "product_picture";
DROP TABLE IF EXISTS "product_recommend";
DROP TABLE IF EXISTS "product_sku";
DROP TABLE IF EXISTS "product";
DROP TABLE IF EXISTS "user_role_permission_relation";
DROP TABLE IF EXISTS "user";
DROP TABLE IF EXISTS "user_favourite";
DROP TABLE IF EXISTS "user_login_history";
DROP TABLE IF EXISTS "user_payment_type";
DROP TABLE IF EXISTS "user_permission";
DROP TABLE IF EXISTS "user_recevie_address";
DROP TABLE IF EXISTS "user_role";
DROP TABLE IF EXISTS "user_role_relation";

CREATE TABLE "user_cart_item" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_id" int4 NOT NULL,
  "product_category_id" int4,
  "product_sku_id" int4,
  "user_id" int4,
  "quantity" int4,
  "price" int8,
  "product_pic" varchar(50),
  "product_name" varchar(50),
  "product_sn" varchar(50),
  "product_sku_code" varchar(50),
  "user_name" varchar(30),
  "create_date" date,
  "modify_date" date,
  "delete_status" bool,
  "product_attr" varchar(255),
  PRIMARY KEY ("id")
);

CREATE TABLE "collection" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "name" varchar(30) NOT NULL,
  "pic" varchar(50) NOT NULL,
  "create_time" date,
  "sort" int4 NOT NULL,
  "status" bool NOT NULL,
  "recommend_status" bool,
  "bg_pic" varchar(50),
  PRIMARY KEY ("id")
);

CREATE TABLE "collection_product" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "collection_id" int4,
  "product_id" int4,
  "sort" int4,
  "status" bool,
   PRIMARY KEY ("id")
);


CREATE TABLE "order" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "order_sn" varchar(50) NOT NULL,
  "user_name" varchar(30) NOT NULL,
  "total_amount" int8 NOT NULL,
  "pay_amount" int8,
  "freight_amount" int8,
  "pay_type" int4 NOT NULL,
  "source_type" varchar(30),
  "delivery_sn" varchar(50),
  "receiver_name" varchar(30) NOT NULL,
  "receiver_zip_code" varchar(10) NOT NULL,
  "receiver_city" varchar(20) NOT NULL,
  "receiver_state" varchar(20) NOT NULL,
  "receiver_address" varchar(255) NOT NULL,
  "receiver_phone" varchar(20) NOT NULL,
  "confirm_status" varchar(10),
  "delete_status" bool,
  "payment_time" date,
  "delivery_time" date,
  "receive_time" date,
  "update_time" date,
  "create_time" date,
  "order_status" int4 NOT NULL,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "order_item" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "order_id" int4 NOT NULL,
  "order_sn" varchar(50) NOT NULL,
  "product_id" int4 NOT NULL,
  "product_pic" varchar(50) NOT NULL,
  "product_name" varchar(30) NOT NULL,
  "product_sn" varchar(50),
  "product_price" int8 NOT NULL,
  "product_quantity" int4 NOT NULL,
  "product_sku_id" int4,
  "product_category_id" int4,
  "product_attr" varchar(200) NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "order_operate_history" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "order_id" int4 NOT NULL,
  "operater" varchar(50),
  "create_time" date,
  "order_status" varchar(10),
  "note" varchar(255),
  PRIMARY KEY ("id")
);

CREATE TABLE "order_return_apply" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "order_id" int4,
  "order_sn" varchar(50),
  "product_id" int4,
  "create_time" date,
  "user_name" varchar(30),
  "return_amount" int8,
  "return_name" varchar(30),
  "return_phone" varchar(20),
  "status" varchar(10),
  "product_name" varchar(30),
  "product_attr" varchar(255),
  "product_pic" varchar(50),
  "product_count" varchar(10),
  "product_price" int8,
  "reason" varchar(255),
  "description" varchar(255),
  "handle_time" date,
  "handle_note" varchar(255),
  PRIMARY KEY ("id")
);

CREATE TABLE "product" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_category_id" int4 NOT NULL,
    "product_category_name" varchar(20)  NOT NULL,
    "name" varchar(30)  NOT NULL,
    "brand" varchar(20)  NOT NULL,
    "product_sn" varchar(32) ,
    "publish_season" varchar(20)  NOT NULL,
    "publish_year" int4 NOT NULL,
    "new_status" bool NOT NULL,
    "sort" int4,
    "sale" int4,
    "price" int8 NOT NULL,
    "rating" float4 NOT NULL,
    "preview_pic" varchar(50)  NOT NULL,
    "unit" varchar(10) ,
    "weight" numeric(10,4),
    "keywords" varchar(20) ,
    "note" varchar(255) ,
    "delivery_type" varchar(20),
    "status" bool NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_attribute" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "name" varchar(30) NOT NULL,
  "sort" int4 NOT NULL,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_attribute_value" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_attribute_id" int4 NOT NULL,
  "value" varchar(255) NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_category_attribute_relation" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "category_id" int4 NOT NULL,
  "attribute_id" int4 NOT NULL,
  "status" bool,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_category" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  "parent_id" int4,
  "name" varchar(30),
  "level" int4,
  "sort" int4,
  "keywords" varchar(20),
  "description" varchar(255),
  "status" bool,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_detail_template" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "type" varchar(10) NOT NULL,
  "title" varchar(30) NOT NULL,
  "detail" text NOT NULL,
  PRIMARY KEY ("id")
);
COMMENT ON COLUMN "product_detail_template"."type" IS 'html or text';

CREATE TABLE "product_detail_template_relation" (
  "id" int4 GENERATED BY DEFAULT AS IDENTITY ,
  "category_id" int4 NOT NULL,
  "template_id" int4 NOT NULL,
  "sort" int4 NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_picture" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_id" int4 NOT NULL,
  "type" int4 NOT NULL,
  "sort" int4 NOT NULL,
  "url" varchar(50) NOT NULL,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);
COMMENT ON COLUMN "product_picture"."type" IS 'album or detail or gallery';

CREATE TABLE "product_recommend" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_id" int4 NOT NULL,
  "product_name" varchar(30),
  "sort" int4,
  "status" bool,
  PRIMARY KEY ("id")
);

CREATE TABLE "product_sku" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "product_id" int4 NOT NULL,
  "sku_code" varchar(255) NOT NULL,
  "price" int8 NOT NULL,
  "stock" int4,
  "low_stock" int4,
  "sale" int4,
  "pic" varchar(50),
  "lock_stock" int4,
  "attr_json" json,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);


COMMENT ON COLUMN "product_sku"."attr_json" IS 'type  [{attr_name,attr_value,attr_value_id}]';

CREATE TABLE "user_role_permission_relation" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "role_id" int4,
  "permission_id" int4,
  PRIMARY KEY ("id")
);

CREATE TABLE "user" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "username" varchar(30) NOT NULL,
  "password" varchar(30) NOT NULL,
  "email" varchar(50),
  "create_time" date,
  "status" bool,
  PRIMARY KEY ("id")
);

CREATE UNIQUE INDEX "username" ON "user" USING btree (
  "username" ASC NULLS LAST
);

CREATE TABLE "user_favourite" (
  "id" int4 NOT NULL,
  "user_id" int4 NOT NULL,
  "collection_id" int4,
  "product_id" int4,
  "category_id" int4,
  "create_time" date,
  "delete_flag" bool,
  PRIMARY KEY ("id")
);

CREATE TABLE "user_login_history" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "user_id" int4,
  "create_time" date,
  "ip" varchar(20),
  "city" varchar(20),
  "login_type" int4,
  PRIMARY KEY ("id")
);

CREATE TABLE "user_payment_type" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "user_name" varchar(20) NOT NULL,
  "card_name" varchar(50) NOT NULL,
  "card_number" varchar(50) NOT NULL,
  "exp_mon" varchar(10) NOT NULL,
  "exp_year" varchar(10) NOT NULL,
  "cvv" varchar(10) NOT NULL,
  "is_default" bool ,
  "card_type" int4 NOT NULL,
  "create_date" date,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);

CREATE UNIQUE INDEX "card_num" ON "user_payment_type" USING btree (
  "card_number"  ASC NULLS LAST
);

CREATE TABLE "user_permission" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "name" varchar(30),
  "value" varchar(255),
  "status" bool,
  "sort" int4,
  PRIMARY KEY ("id")
);

CREATE TABLE "user_recevie_address" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "user_name" varchar(20) NOT NULL,
  "first_name" varchar(30) NOT NULL,
  "second_name" varchar(30) NOT NULL,
  "address" varchar(255) NOT NULL,
  "city" varchar(20) NOT NULL,
  "state" varchar(20) NOT NULL,
  "zipcode" varchar(10) NOT NULL,
  "phone" varchar(20) NOT NULL,
  "is_default" bool ,
  "create_time" date,
  "status" bool NOT NULL,
  PRIMARY KEY ("id")
);

CREATE TABLE "user_role" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "name" varchar(30),
  "description" varchar(255),
  "create_time" date,
  "status" int4,
  PRIMARY KEY ("id")
);

CREATE TABLE "user_role_relation" (
  "id" int4 NOT NULL GENERATED BY DEFAULT AS IDENTITY ,
  "role_id" int4 NOT NULL,
  "user_id" int4 NOT NULL,
  PRIMARY KEY ("id")
);

ALTER TABLE "order_item" ADD CONSTRAINT "fk_order_item_order_1" FOREIGN KEY ("order_id") REFERENCES "order" ("id");
ALTER TABLE "product_sku" ADD CONSTRAINT "fk_product_sku_product_1" FOREIGN KEY ("product_id") REFERENCES "product" ("id");

